app.controller("profilCtrl",["$scope","$http","serviceApi","$routeParams",function(t,n,o,e){t.contactStud=1,t.verifChamps=!1,t.contactStudent=function(){$(".inputMail").val().length>0&&$(".textAreaMail").val().length>0?t.contactStud=2:t.verifChamps=!0};var r=e.id_profil;n.get(o.profilUser+r).then(function(n){t.student=n.data},function(t){console.log("Error")})}]);